import React from 'react';
import './Main.css';
import SearchBar from './SearchBar';
import logo from '../images/logo.svg';
import Typist from 'react-typist';

function Main() {
  return (
    <div className='main-container'>
      <img className='main-logo' src={logo} alt='logo'></img>
      <h1 className="home-title text-white">
        <Typist>
          <span className='main-ele'> 국내 최초, 최고의 시간 기반 법령 검색 엔진 </span>
          <Typist.Backspace count={49} delay={200} />
          <span className='main-ele'> 이 맞아 확실해? </span>
          <Typist.Backspace count={16} delay={200} />
          <span className='main-ele'> LegalEngine<span className='main-ele-dot'>. </span></span>
        </Typist></h1>
      <SearchBar />
    </div>
  );
}

export default Main;
